import { Link } from 'react-router-dom';
import './styles.scss';

export default class SobreDescricao extends Component {  
    render() {
        return (
            <React.Fragment>
                <section className="sobre">
                    <div className="container-sobre">
                        <h1 className="sobre-titulo">O PlayerStars é o lugar onde duelos épicos acontecem. <br/>Onde o que define o jogo é sua habilidade de vencer.<br/>E onde quem conquista o universo dos games ganha na vida real.</h1>
                        <div className="div-descricao">
                            <p className="descricao-sobre">Sua missão? Desafiar, duelar e conquistar a vitória na primeira Plataforma Digital para Duelo de
                                ames do mundo: aperte start e conheça o PlayerStars.</p>
                            <p className="descricao-sobre">Para adicionar mais emoção nas partidas dos jogos que você já domina, a estratégia é simples: entre
                                na disputa, desafie outros gamers, vença batalhas acirradas e a vitória é sua.</p>
                            <p className="descricao-sobre"><b>O MAIS IMPORTANTE É QUE NO PLAYERSTARS YOU WIN É PRA VALER:
AQUI TEM GRANDES LUCROS NA JOGADA</b></p>
                            <p className="descricao-sobre">Quisque blandit ipsum sit amet urna viverra convallis. Classiti sociosqu ad litora torquent per conubia nostra, inceptos himenaeos. Sed sit amet posuere justo.</p>
                            <p className="descricao-sobre">Quisque blandit ipsum sit amet urna viverra convallis. Classiti sociosqu ad litora torquent per conubia nostra, inceptos himenaeos. Sed sit amet posuere justo.</p>
                            <Link to="/cadastro"><button className="btn-participe">Participe</button></Link>
                        </div>
                    </div>
                </section>
            </React.Fragment>
        )
    }
}
